import { Form } from "react-bootstrap";

const FormSelect = (props) => {
  return (
    <>
      <Form.Label>User Roles</Form.Label>
      <Form.Select>
        {/* <option value="Admin"></option> */}
      </Form.Select>
    </>
  );
};
export default FormSelect;
